import React, { Component } from 'react';
import CanvasJSReact from '../../assets/canvasjs.react';
var CanvasJSChart = CanvasJSReact.CanvasJSChart;

var bgColors = { "Default": "#81b71a",
                    "Blue": "#00B1E1",
                    "Cyan": "#37BC9B",
                    "Green": "#8CC152",
                    "Red": "#E9573F",
					"Yellow": "#F6BB42",
					"White" : "#FFFFFF",
					"Black" : "#000000",
};

const divStyle = {
	height: '750px',
    backgroundColor: 'lightgray'
  };
 
class RangeBarChart extends Component {
		render() {
		const options = {
			animationEnabled: true,
			dataPointMaxWidth: 12,
			title:{
				text: "",
				fontFamily: "helvetica"
			},
			subtitles: [{
				text: "",
				fontFamily: "helvetica"
			}],
			axisY: {
				title: "",
				prefix: "",
				lineThickness: 1
			},
			axisX: {
				title: "",
				prefix: "",
				lineThickness: 0,
				interval : 1,
				tickLength : 0,
				margin : 0,
				valueFormatString : " "
			},
		
			data: [{
				type: "rangeBar",
				indexLabel: "{y[#index]}",
				yValueFormatString: "#,##0",
				dataPoints: [
					{ label: "", y: [25, 40] },
					{ label: "", y: [0, 25] },
					{ label: "", y: [25, 30] },
					{ label: "", y: [30, 35] }
					
				]
			}]
		}
		
		return (
		// <div>
		// 	<h1>React Range Bar Chart</h1>
		// 	<div><span>Transformer</span></div>
		// 	<CanvasJSChart options = {options} 
		// 	/>
		// </div>

		<div>
			<table>
				<tr>
					<td height="100" width="100%">
						<div style={divStyle}>
							{/* <h1>React Range Bar Chart</h1> */}
						 	<div><span>Transformer</span></div>
						 	<CanvasJSChart options = {options} 
						 	/>
						</div>
					</td>

					<td height="100">
						<div id="wrapper" style={{backgroundColor: bgColors.Black}}>
							<p>1 /4654 /4651 /4664</p>
							<h3><span>Segment 4660</span></h3>
							<div><span>Distance :</span></div>
							<div><span>Distance to transformer :</span></div>
							<div><span>Variance :</span></div>
							<div><span>Cross phase Adjustment :</span></div>
							<div><span>&nbsp;</span> </div>
							<div><span>Devices :</span></div>

							<div>
								<div><span>&nbsp;</span> </div>
								<div>
									<span>&nbsp;HP&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Serial No.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
										&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;GHI score</span>
								</div>
								<div><span>&nbsp;</span> </div>
							</div>

						</div>
					</td>
				</tr>
			</table>
		</div>
		);
	}
}

export default RangeBarChart;
